import React, { useEffect, useState } from "react";
import Navbar from 'react-bootstrap/Navbar'
import { Nav,Col,Row,Container,Form,Button} from "react-bootstrap"
import navItems from "static/data/menu"
const Footer = () => {
    const [orchestraEnsemble, setOrchestraEnsemble] = useState();
    const [conductor, setConductor] = useState();
    const [nameOfPiece, setNameOfPiece] = useState();
    const [validated, setValidated] = useState(false);
    useEffect(() => {
        // Update the document title using the browser API

        // eslint-disable-next-line react-hooks/exhaustive-deps
      }, []);
    const NavList = () => {
       return  navItems.map(item => {
        return <Nav.Link href={`#${item}`}>{item}</Nav.Link>
    })}
    const handleSubmit = event => {
        event.preventDefault();

        let concertItem = {
            orchestraEnsemble,
            conductor,
            nameOfPiece
        }
        const form = event.currentTarget;
        if (form.checkValidity() === false) {
          event.stopPropagation();
        }
        setValidated(true);

      };

    const date = new Date();
    const Year = date.getFullYear()
    return (<>

<footer class="page-footer font-small blue pt-4">
    <Container>
    <Row>
    <Col md={6}>

<h5 class="text-uppercase">Send us your concert information:</h5>
<Form noValidate validated={validated} onSubmit={handleSubmit}>

                <Form.Row>
                  <Form.Group as={Col}  controlId="title">
                    <Form.Control
                      required
                      type="text"
                      placeholder="Orchestra, Ensemble:"
                      defaultValue={""}
                      onChange={e => setOrchestraEnsemble(e.target.value)}

                    />
                    <Form.Control.Feedback type="invalid">
                        Please provide a title.
                      </Form.Control.Feedback>
                    <Form.Control.Feedback>Looks good!</Form.Control.Feedback>
                  </Form.Group>
                  </Form.Row>
                <Form.Row>
                  <Form.Group as={Col} controlId="date">
                    <Form.Control
                      required
                      type="text"
                      placeholder="Conductor"
                      defaultValue={""}
                      onChange={e => setConductor(e.target.value)}

                    />
                    <Form.Control.Feedback type="invalid">
                        Please provide a product description.
                      </Form.Control.Feedback>
                    <Form.Control.Feedback>Looks good!</Form.Control.Feedback>
                  </Form.Group>

                </Form.Row>
                <Form.Row>
                  <Form.Group as={Col} controlId="date">
                    <Form.Label>Name of Piece:</Form.Label>
                    <Form.Control
                      required
                      type="text"
                      placeholder=""
                      defaultValue={""}
                      onChange={e => setNameOfPiece(e.target.value)}

                    />
                    <Form.Control.Feedback type="invalid">
                        Please provide a product description.
                      </Form.Control.Feedback>
                    <Form.Control.Feedback>Looks good!</Form.Control.Feedback>
                  </Form.Group>

                </Form.Row>
                <Form.Row>
                  <Form.Group as={Col} controlId="date">
                    <Form.Label>Date, Time, Location:</Form.Label>
                    <Form.Control
                      required
                      type="text"
                      placeholder=""
                      defaultValue={""}
                      onChange={e => setConductor(e.target.value)}

                    />
                    <Form.Control.Feedback type="invalid">
                        Please provide a product description.
                      </Form.Control.Feedback>
                    <Form.Control.Feedback>Looks good!</Form.Control.Feedback>
                  </Form.Group>

                </Form.Row>

                <Button type="submit">Update</Button>
              </Form> 

</Col>
    </Row>
    <div className="footer-copyright text-center py-3">{`© ${Year} Copyright johandemeij.com`}</div>
    </Container>
</footer>

      </>)
}
export default Footer
